public T next() {
  if (!nextIsSet) {
    if (!setNext()) {
      throw new NoSuchElementException();
    }
  }
  nextIsSet = false;
  return next;
}

public final T next() {
  if (!hasNext()) {
    throw new NoSuchElementException();
  }
  assert nextIsSet;
  try {
    return next;
  } finally {
    nextIsSet = false;
    next = null;
  }
}

